import React from 'react';
import './App.css';
import DashboardCosmetique from "./Pages/DashboardCosmetique/DashboardCosmetique";
import DashboardMode from "./Pages/DashboardMode/DashboardMode";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Navbarre from "./Component/Navbarre/Navbarre";

export default function App() {
  return (
  <BrowserRouter>
    <Routes>
        <Route path="/dashboardCosmetique" exact component={DashboardCosmetique} />
            <Route
              path="/dashboardMode"
              exact
              component={DashboardMode}
            />
      </Routes>
    </BrowserRouter>
  );
}
